import React, {useEffect, useState} from 'react'
import styled from 'styled-components'

export const Vote = () => {

    return (
        <Container>
            <TitleBox>
                Best Assets AP 2025
            </TitleBox>
        </Container>
    )
}


const TitleBox = styled.div`
    position: fixed;
    display: flex;
    height: 100px;
    width: 100%;
    justify-content: center;
    align-items: center;
    font-size: 30px;
    font-style: bold;
    background-color: #7dbdd4;

`

const Container = styled.div`
    display: flex;

    width: 100%;
    height: 100%;
    justify-content: center;
`
